/* 18 */
SELECT orders.productId, products.title, count(orders.productId) AS product_count, products.price, products.count FROM orders JOIN products ON orders.productId = products.id GROUP BY orders.productId HAVING count(orders.productId) > 1 ORDER BY orders.productId;

/* 19 */
SELECT products.id, count(products.id) AS product_count, products.title, users.region, products.price, products.count, products.published FROM users INNER JOIN orders ON users.id = orders.userId INNER JOIN products ON orders.productId = products.id GROUP BY products.id, region HAVING count(products.id) > 1 ORDER BY region asc;

/* 20. RUN 21 FIRST Check inventory at the end of each month */
select b.x-a.x from inventory b inner join inventory a on b.year=a.year and b.month=a.month-1;

/* 21. create views */
create view inventory as select count(id) as x, YEAR(createdAt) as year, MONTH(createdAt) as month from products group by YEAR(createdAt), MONTH(createdAt);
select * from inventory;

/* 22. Trigger: update count in products after insertion in orders. */
create trigger after_insert_order after insert on orders for each row update products set count = count-new.quantity where id = new.productId;
select * from products where id = 1;
select * from products where id = 1;

/* 23 */
create view active_orders as select o.id, o.userId, u.first_name, u.last_name, u.region, o.orderActive from orders o, users u where orderActive=1 and o.userId=u.id;
select * from active_orders;

/* 24 Trigger update of Active view when an order is delivered. */
delimiter //
create trigger afer_update_orders
after update on orders 
for each row 
begin
if (old.orderActive ='1' and new.orderActive = '0') then
		delete from active_orders where id=old.id;
        end if;
end; //
delimiter ;

select * from active_orders;
update orders set orderActive=0 where id=3;
