/* 25 */
SELECT users.id AS user_id, users.first_name, users.last_name, users.region, products.id AS product_id, products.title, products.price, products.count FROM users INNER JOIN orders ON users.id = orders.userId INNER JOIN products ON orders.productId = products.id ORDER BY orders.userId;

/* 26 */
SELECT users.id AS user_id, users.first_name, users.last_name, users.region, products.id AS product_id, products.title, products.price, products.count, orders.createdAt, orders.updatedAt FROM users INNER JOIN orders ON users.id = orders.userId INNER JOIN products ON orders.productId = products.id ORDER BY YEAR(orders.createdAt) desc, MONTH(orders.createdAt) desc;

/* 27 group active orders by region. */
select region, count(*) as numberOfActiveOrders from active_orders group by region order by region;

/* 28 Find orders made on the same date (self join)*/
select o1.id as OrderId, o1.userId as Customer, o1.productId as Product, o1.quantity as quantity, o1.orderActive as Delivered, o1.orderCancelled as Cancelled, o1.createdAt as OrderDate, 
o2.id as OrderId, o2.userId as Customer, o2.productId as Product, o2.quantity as quantity, o2.orderActive as Delivered, o1.orderCancelled as Cancelled, o2.createdAt as OrderDate
from orders o1, orders o2 where o1.createdAt = o2.createdAt and o1.userId <> o2.userId group by o1.createdAt order by o1.createdAt;

